import React from 'react';
import styled from 'styled-components';

import { NavLink } from 'react-router-dom';
import {Div, Table} from '../styles/DefaultStyles';


const DivTableEntry = styled(Div)`
  display: flex;
  flex-direction: column;
  justify-content: flex-start;
  align-items: center;
`

const TableEntryElement = styled(Table)`
`

const TrPlayer = () => {

  const listplayer = [
      {_id: "iceman", mmr: 2000}
      ,{_id: "fireman", mmr: 1900}
    ]

  return listplayer.map((player, i) => {

    const { _id, mmr } = player //destructuring

    return (
      <tr key={_id}>
         <td>{_id}</td>
         <td>{mmr}</td>
      </tr>
     )

  })

}

 const TableEntry = () => {
	return (

  <DivTableEntry>

    <h2 >Entry</h2>

    <TableEntryElement>
      <tbody>
        {TrPlayer()}
      </tbody>
    </TableEntryElement>


	</DivTableEntry>

	)
}

export default TableEntry;
